import styled from 'styled-components';



export const Container = styled.div`
  max-width: 1270px;
    margin: 0 auto;
    position: relative;
    padding: 0 20px;
`;

export const HeaderTitle = styled.div`
        padding-top: 21px;
        padding-bottom: 38px;
        font-size: 20px;
    font-weight: 700;
    line-height: 24px;

    color: #000;
